  false,\n\t\"url\": null,\n\t\"notes\": \"This document is the construction plans
  and Design Report for the Lake Mason Project to be constructed late summer, 1997.
  \ The project consists of creating an embankment with gated culverts bisecting the
  lake creating a north and south unit.  The goal of the project is to increase the
  average depth of the remaining marsh in order to provide water through the brood
  rearing period.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
